import React,{Component} from 'react';
import { library } from '@fortawesome/fontawesome-svg-core';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
// import { faQq,faWeibo,faAlipay } from '@fortawesome/free-solid-svg-icons';
library.add(faQq,faWeibo,faAlipay)

class Login extends Component{
    render(){
        return (
            <div className="login">
                <div>
                    <input type="text" placeholder="请输入手机/邮箱" />
                    <input type="text" placeholder="请输入密码" />
                    <p>忘记密码</p>
                    <input type="button" value="登录" />
                    <input type="button" value="注册" />
                </div>
                <div>
                    <p>第三方登录</p>
                    <p>
                        <FontAwesomeIcon icon="qq" />
                        <FontAwesomeIcon icon="weibo" />
                        <FontAwesomeIcon icon="alipay" />
                    </p>
                </div>
            </div>
        )
    }
}

export default Login
